import React from 'react';

const Footer = () => (
  <footer className="w-full py-6 bg-slate-100 text-center text-gray-500 text-sm mt-8">
    <div>
      IA Mini Assistant &copy; {new Date().getFullYear()} &middot; 
      <a
        href="https://github.com/marchalseverine/IA_mini_assistant"
        target="_blank"
        rel="noopener noreferrer"
        className="text-blue-600 hover:underline"
      >
        GitHub
      </a>
      {" | Built by Séverine Marchal"}
    </div>
  </footer>
);

export default Footer;
